import Book from "./Book";

function Library(props) {
    return (
        <div>
            <Book name = "cdd" numOfPage = {100}/>
            <Book name = "is" numOfPage = {200}/>
            <Book name = "god" numOfPage = {300}/>
        </div>
    )
}

export default Library
